def TVD_RK3_step(dydt, t0, y0, dt):

    t,y = t0,y0
    k1 = dydt(t, y)
    k2 = dydt(t + dt, y + dt*k1)
    k3 = dydt(t + dt/2., y + dt*( (1./4)*k1 + (1./4)*k2 ) )
    return y + dt*(1./6)*( k1 + k2 + 4*k3 )

