def get_K_from_Y_and_L(Y, L, K_g, p, method):
    r
    if method == "SS":
        Z = p.Z[-1]
    else:
        Z = p.Z[: p.T]
    K = (
        (
            (Y / Z) ** ((p.epsilon - 1) / p.epsilon)
            - (1 - p.gamma - p.gamma_g) * L ** ((p.epsilon - 1) / p.epsilon)
            - (p.gamma_g ** (1 / p.epsilon))
            * (K_g ** ((p.epsilon - 1) / p.epsilon))
        )
