def pow(a, b, fast=True):
    r
    if type(b) is not int:
        raise TypeError("Exponent should be a positive integer.")
    if b < 1:
        raise ValueError("Exponent should be a positive integer.")
    result = a
    b -= 1
    if fast:  # O(log b)
        while b > 0:
            if b % 2 == 1:
                result *= a
                b //= 2
            a *= a
    else:  # O(b)
        while b > 0:
            result *= a
            b -= 1
    return result

