def cell_size(layout):

    ex = layout.extent
    w = float(abs(ex.xmax - ex.xmin))
    h = float(abs(ex.ymax - ex.ymin))
    tl = layout.tileLayout
    return (w / (tl.layoutCols * tl.tileCols), h / (tl.layoutRows * tl.tileRows))

